import zhMessages from "../locales/zh-Hans.json";

const zh = "输入新密码并进行确认。";

zhMessages["sidebar.publisher"] = "输入新";

const ZhLan = {
  messages: {
    ...zhMessages,
  },
  antd: null,
  locale: "zh-Hans-CN",
};
export default ZhLan;
